import React from "react"
import Deck from "./Deck/Deck";
import Mixer from "./Mixer/Mixer";

import "./console.scss";
import Recorder from "./Recorder/Recorder";

const Console = props =>{


    return (
        <div className="truck-console">
            <Deck name="A">A</Deck>
            <div class="console-group">
                <Recorder/>
                <Mixer />
            </div>
            <Deck name="B">B</Deck>
        </div>
    )
}


export default Console;
